def round2(v: Double): Double =  Math.round(100.0 * v) /100.0 
def safeLog(v: Double): Double = if(v.isNaN || v <= 1) 0.0 else round2(Math.log(v)) 

def logs(df: DataFrame, cols: List[String]) = {
  val fun = udf[Double, Double](safeLog)
  cols.foldLeft(df){
    case (acc, c) => acc.withColumn(c, fun(new ColumnName(c)))
  }
}

//html support 
def html(str: String) = print("%html "+str)
def script(str: String) = html("<script>\n" + str + "</script>")
def plotly() = html("""<script src="https://cdn.plot.ly/plotly-latest.js" charset="utf-8"></script>""")
def div(id: String) = html(s"""<div id="${id}"></div>""")

def heatmap(vec: DataFrame, id: String, x: Seq[String], y: Seq[String], title: String,  left: Int = 300, top: Int = 250, width: Int = 1200, height: Int = 1000, labels: Boolean = true, logData: Boolean = false, logAnnotations: Boolean = false, colorScale: String = "RdBu", inverse: Boolean = false, showScale: Boolean = true, zmin: Double = 0.0, zmax: Double = 0.0) = {

val cv: Array[Array[Double]] = collectVec(vec)
val numbers = cv.map(arr=>arr.map(n => round2(n))) //val vs = if(inverse) {val max: Double =numbers.map(_.max).max numbers.map(arr => arr.map(max - _)) } else numbers
val data =        numbers.map(arr=>seq2NumArray(arr.map{number=> if(logData) safeLog(number) else number })).mkString(",")
val annotations = numbers.map(arr=>seq2NumArray(arr.map{number=> if(logAnnotations) safeLog(number) else number })).mkString(",")
val start = s"""
var layout = {
  title: '${title}',
  annotations: [],
  margin: {
    l: ${left},
    r: 125,
    t: ${top},
    b: 50
  },
  width: ${width},
  height: ${height},
  xaxis: {
    side: 'top'
  },
  yaxis: {
    side: 'left',
    autorange: 'reversed',
  }
};

var xValues = ${seq2StringArray(x)}
var yValues =  ${seq2StringArray(y)}
var zValues =  [${data}]
var aValues =  [${annotations}]

"""
val end = s"""
var data = [{
   x: xValues,
   y: yValues,
   z: zValues,
   ${if(zmin < zmax) "zmin: " + zmin + ", zmax: "+ zmax + ","  else ""}
   colorscale: '${colorScale}', ${if(showScale) "" else " showscale: false ,"}
   type: 'heatmap' ${if(inverse) ", reversescale: true" else ""}
 }];
 Plotly.newPlot('${id}', data, layout);
"""

val middle = s"""
for ( var i = 0; i < yValues.length; i++ ) {
  for ( var j = 0; j < xValues.length; j++ ) {
    var currentValue = zValues[i][j];
    if (currentValue != 0.0) {
      var textColor = 'white';
    }else{
      var textColor = 'black';
    }
    var result = {
      xref: 'x1',
      yref: 'y1',
      x: xValues[j],
      y: yValues[i],
      text: aValues[i][j],
      font: {
        family: 'Arial',
        size: 5,
        color: 'rgb(50, 171, 96)'
      },
      showarrow: false,
      font: {
        color: textColor
      }
    };
    layout.annotations.push(result);
  }
}
"""
val res: String = if(labels) start + middle + end else start + end
script(res)
}

def makeHeatmap(df: DataFrame, label: String, features: Seq[String], div: String, title: String, left: Int = 300, top: Int = 300, width: Int = 1000, height: Int = 1000, labels: Boolean = true, logData: Boolean = false, logAnnotations: Boolean = false, colorScale: String = "RdBu", inverse: Boolean = false, showScale: Boolean = true, zmin: Double = 0.0, zmax: Double = 0.0) = {
    val y = df.select(label).as[String].collect.toList
    val x = features.toList
    val vec = df.toVectors(features, "features")
    heatmap(vec, div, x, y, title, left, top, width, height, labels, logData, logAnnotations, colorScale, inverse, showScale, zmin, zmax)
}

val withLiver = udf[String, String]{ str => "LIVER: " + str}
val withKidney = udf[String, String]{ str => "KIDNEY: " + str}
val noLiverKidney = udf[String, String]{ str => str.replace("_liver", "").replace("_kidney", "")}
val noLiverKidneyRanks = udf[String, String]{ str => str.replace("_liver", "").replace("_kidney", "") + " (rank)"}

def splitChart(go: String, liver: DataFrame = liver_pro_ranks, kidney: DataFrame = kidney_pro_ranks) = {
    val liv1 = transposeUDF(liver.where($"go" === go), Seq("go", "label")).withColumn("label", withLiver($"label"))
    val kid1 = transposeUDF(kidney.where($"go" === go), Seq("go", "label")).withColumn("label", withKidney($"label"))
    liv1.union(kid1).withColumn("column_name", noLiverKidneyRanks($"column_name"))
}
